import React, { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [data, setData] = useState(null);
  const [analysis, setAnalysis] = useState(null);

  // Fetch the JSON from your Python backend
  useEffect(() => {
    fetch('http://localhost:5001/api/output')
      .then((response) => response.json())
      .then((jsonData) => {
        setData(jsonData);
        // Parse the custom_rag_analysis to get the analysis sections
        try {
          const customRagData = JSON.parse(jsonData.custom_rag_analysis.output);
          const parsedData = JSON.parse(customRagData.custom_rag_analysis.output);
          setAnalysis(parsedData);
        } catch (err) {
          console.error('Error parsing custom_rag_analysis:', err);
        }
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, []);

  // Always call the hook; then check for data inside
  useEffect(() => {
    if (!data) return;

    const toggleAccordion = (header) => {
      header.classList.toggle('active');
      const content = header.nextElementSibling;
      if (content) {
        content.classList.toggle('show');
      }
    };

    const accordionHeaders = document.querySelectorAll('.accordion-header');
    accordionHeaders.forEach((header) => {
      const handler = () => toggleAccordion(header);
      header.addEventListener('click', handler);
      header._toggleHandler = handler;
    });

    return () => {
      accordionHeaders.forEach((header) => {
        if (header._toggleHandler) {
          header.removeEventListener('click', header._toggleHandler);
        }
      });
    };
  }, [data]);

  if (!data) {
    return <div>Loading...</div>;
  }

  // Parse all the outputs from the backend
  let callSummaryOutput = {};
  try {
    callSummaryOutput = JSON.parse(data.call_summary.output);
  } catch (err) {
    console.error('Error parsing call_summary:', err);
  }

  let buyerIntentOutput = {};
  try {
    // Parse the outer wrapper
    const buyerIntentData = JSON.parse(data.buyer_intent.output);
    // Parse the inner wrapper
    const innerData = JSON.parse(buyerIntentData.buyer_intent.output);
    buyerIntentOutput = innerData;
    console.log('Parsed buyer intent:', buyerIntentOutput); // Debug log
  } catch (err) {
    console.error('Error parsing buyer_intent:', err);
  }

  let profanityCheckOutput = {};
  try {
    const profanityData = JSON.parse(data.profanity_check.output);
    profanityCheckOutput = JSON.parse(profanityData.profanity_check.output);
  } catch (err) {
    console.error('Error parsing profanity_check:', err);
  }

  return (
    <div className="container">
      <div className="top-bar">
        <div className="logo">Call Insights</div>
      </div>

      <div className="content">
        <div className="sidebar">
          <h2>Call Rating</h2>
          <div className="match-rate-circle" data-percentage={callSummaryOutput.rating || 0}>
            <span className="percentage">{callSummaryOutput.rating || 0}%</span>
          </div>

          <div className="sidebar-section">
            <h4>Buyer Intent</h4>
            <p>
              <strong>Predicted:</strong>{' '}
              <span style={{ color: 'green' }}>{buyerIntentOutput.nlp || 'N/A'}</span>
            </p>
          </div>

          <div className="sidebar-section">
            <h4>Profanity Detection</h4>
            <p>
              <strong>Severity Level:</strong> {profanityCheckOutput['severity level'] || 'N/A'}
            </p>
            <p>{profanityCheckOutput.report || 'N/A'}</p>
          </div>
        </div>

        <div className="main-section">
          <div className="section-card">
            <h3>Call Summary</h3>
            <p>{callSummaryOutput.summary || 'No summary available'}</p>
            <h3>Overall Call Score: {callSummaryOutput.rating || 0}/100</h3>

            <div className="analysis-sections">
              <div className="analysis-section">
                <h4>Strengths</h4>
                <div className="bullet-points">
                  <p>{callSummaryOutput.strengths || 'No strengths available'}</p>
                </div>
              </div>

              <div className="analysis-section">
                <h4>Areas for Improvement</h4>
                <div className="bullet-points">
                  <p>{callSummaryOutput.areas_for_improvement || 'No improvements available'}</p>
                </div>
              </div>
            </div>
          </div>

          {analysis && (
            <div className="section-card">
              <div style={{ display: 'flex', flexWrap: 'wrap', gap: '2rem' }}>
                <div style={{ flex: 1 }}>
                  <h3>Strengths</h3>
                  <ul>
                    {analysis.strengths && analysis.strengths.map((strength, index) => (
                      <li key={index}>
                        <strong>{strength.title}:</strong> {strength.description}
                      </li>
                    ))}
                  </ul>
                </div>
                <div style={{ flex: 1 }}>
                  <h3>Areas for Improvement</h3>
                  <ul>
                    {analysis.improvements && analysis.improvements.map((improvement, index) => (
                      <li key={index}>
                        <strong>{improvement.title}:</strong> {improvement.description}
                      </li>
                    ))}
                  </ul>
                </div>
              </div>
            </div>
          )}

          <div className="section-card">
            <h3>Detailed Analysis</h3>
            <div className="accordion">
              {analysis && Object.entries(analysis).map(([key, value]) => (
                <div className="accordion-item" key={key}>
                  <div className="accordion-header">{key}</div>
                  <div className="accordion-content">
                    <p>{value}</p>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
